    private Context context;
    private static String TAG = "NetworkAPI";

    private String json;
    private String endpoint;

    private boolean started = false;

    public NetworkApiAccess(Handler handler, Context ctx){
        this.handler = handler;
        this.context = ctx;
    };



    @Override
    public void run() {

        while(this.started) {
            try {
                String result = sendJsonPacket(this.json, this.endpoint);
                if (result.isEmpty()) {
                    result = "Fail";
                }
                Log.d(TAG, result);
                Message m = new Message();
                Bundle b = new Bundle();
                b.putString("RESULT", result);
                m.setData(b);
                this.handler.sendMessage(m);

            } catch (NetworkException e) {
                Log.d(TAG, "Exception: " + e.getMessage());
            }
            this.started = false;                                               // Executes Run just once
        }
    }

    public void startHttpPost(String json, String endpoint) {
        this.started = true;
        this.endpoint = endpoint;
        this.json = json;

        this.start();
    }

